    return (
        <div>
            <header className="app-header">
                <h1>日常生活アプリ</h1>
            </header>

            <nav className='app-date'>
                <p>今日の日付: {new Date().toLocaleDateString('ja-JP')}</p>
            </nav>
            <ul>
                <li>
                    <a href="/home">ホーム</a>
                </li>
                <li>
                    <a href="/todo">ToDoリスト</a>
                </li>
                <li>
                    <a href="/setting">設定</a>
                </li>
                <li>
                    <a href="/progress">マップ</a>
                </li>
            </ul>
        </div>

    );
}
export {Header};
